import React, {Component} from "react";
// import "./Detail.css";

class Detail extends Component {

  constructor(props) {
    super(props);
    this.state = { showDetail: false
    }
  }

  render(){
    return(
      <div className="detail-shade"> 
        <img src={props.detailImg.url}/>
      </div>
    )
  }
}

export default Detail;
